import React from "react";

const LoginPage = () => {
    return(
        <>
            <div className="login-page">
                <div className="login-component">
                    <h1>Login Page</h1>
                    <div className="my-3 w-100">
                        <h3>Login</h3>
                    </div>
                </div>
            </div>
        </>
    )
}

export default LoginPage
